const getWordsInQuotes = (str: string) => {
  // const match = str.match(/"(?:[^"\\]|\\.)*"/)
  const match = str.match(/[^"]+(?=(" ")|"$)/g)

  if (match) {
    console.log(match)
    return match[0];
  }

  return "";
};

export default getWordsInQuotes;
